// SPDX-License-Identifier: MIT

pragma solidity ^0.8.15;

contract MoneyTransfer {


    uint256 public amount;
    uint256 public TotalFunds;
    address receiver ;
    uint256 constant limit = 2000;
    uint day = 24 hours;
    uint256 public totalWeekTransactions;
    uint maxTransaction;
    uint minTransaction;
    uint256[] countries ; 


    constructor (uint256){

    }


    function sendMoney(uint _amount, address _receiver) public m_validAddress(_receiver) {
        receiver = _receiver;
        amount = _amount;

        if(TotalFunds > 0 && TotalFunds > amount){
            TotalFunds -= amount;
        }
    }

    modifier m_validAddress(address _addr) {
        receiver = _addr;
        require(_addr != address(0), " This address doesn't exists");

        _;
    }
}

